import { Card, CardContent, Grid, makeStyles, TextField } from '@material-ui/core';
import React from 'react';
import "./createQuiz.css"
import AdminLink from '../management/AdminLinks';

const useStyles = makeStyles((theme) => ({
    root: {
      width: '100%',
    },
    gridContainer: {
      paddingTop:"20px",
      minHeight:"100vh"
    },
    paper: {
        padding: theme.spacing(2),
        textAlign: 'center',
        color: theme.palette.text.secondary,
      },
    headPart:{
        backgroundColor:"#133b5c",
      color:"#ffff"
    },
    icon:{
        color:"#fff"
    },
    categorytitle:{
        color:"#133b5c",
        fontSize:"35px",
        fontWeight:"600",
        textAlign:"center"
    },
    heading: {
      fontSize: theme.typography.pxToRem(20),
      fontWeight: theme.typography.fontWeightRegular,
    },
  }));

function CreateQuiz() {
    const classes = useStyles();
    return (
        <div className={classes.root}>
        <AdminLink/>
          <Grid
                container
                className={classes.gridContainer}
                justify="center"
             >
                    <Grid container>
                    <Grid item xs></Grid>
                    <Grid item xs={11} sm={6} md={6} lg={4} >
                    <div className="createnumber">
                        <h3>Title</h3>
                    </div>
                      <Card className="create-list">
                                  <Grid
                                  container
                                 >
                               <input  type="text" id="title" className="title-text"
                            name="title"
                            placeholder="Title"
                            />
                               </Grid>
                      </Card>
                    </Grid>
                    <Grid item xs></Grid>
                  </Grid>
                    <Grid item xs></Grid>
                    <Grid item xs={11} sm={6} md={6} lg={4} >
                    <div className="createnumber">
                        <h3>Slug</h3>
                    </div>
                      <Card className="create-list">
                                  <Grid
                                  container
                                 >
                               <input  type="text" id="slug" className="title-text"
                            name="slug"
                            placeholder="Slug"
                            />
                               </Grid>
                      </Card>
                    </Grid>
                    <Grid item xs></Grid>
         </Grid>
        </div>
    )
}

export default CreateQuiz
